  null,\n\t\"notes\": \"This report is the result of a study commencing July 3, 1970
  and ending August 20 1970. The study area was the Coyote Buttes Field just east
  of refuge headquarters. The site is adjacent to the buildings previously occupied
  by the Job Corps Center. The purpose of this study is to attempt to determine the
  major nesting waterfowl species, number and sizes of broods, location of broods
  within the area, and rate of water loss from the area. Incidental to the aforementioned
  information, an attempt was made to record the variety of other wildlife seen in
  the area.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
